import ajax from "../utils/ajax";

export const login = data => ajax({
    url: "./login",
    data
})

// export const booksSearch = data => console.log(ajax({
//     url: "http://82.156.102.187:8001/api/search/",
//     data
// }))

export const booksSearch = data => {
    const result = ajax({
        url: "http://82.156.102.187:8001/api/search/",
        data
    });

    console.log(result);
}
